import React from "react";
const Form=()=>{
    return(
        <div className="container">
            <label>Full name</label>
            <input type="text"/>
            <label>Email</label>
            <input type="email"/>
            <label>Phone</label>
            <input type="number"/>
            <label>Password</label>
            <input type="password"/>
            <label>Confirm password</label>
            <input type="password"/>
            <button>Sign Up</button>
        </div>
    );
}
export default Form;
